import React from 'react';
import SecondaryLayout from "../_layouts/default/SecondaryLayout";
import PageCaptionSpacer from "../common/PageCaptionSpacer";
import Typography from "@material-ui/core/Typography";
import {Btn, ButtonsGroup, FormWrapper, InnerFormSpacer} from "../common/form_components";
import Grid from "@material-ui/core/Grid";
import TextField from "@material-ui/core/TextField";
import FormGroup from "@material-ui/core/FormGroup";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Checkbox from "@material-ui/core/Checkbox";
import LongCompIcon from "../common/LongCompIcon";
import LongCompDefault from "../../assets/long_icon.svg";
import LongCompActive from "../../assets/long_icon_active.svg";
import ShortCompIcon from "../common/ShortCompIcon";
import ShortCompDefault from "../../assets/short_icon.svg";
import ShortCompActive from "../../assets/short_icon_active.svg";
import Switch from "@material-ui/core/Switch";

function CompForm(props) {
    return (
        <>
            <Grid container spacing={3}>
                <Grid item xs={12}>
                    <TextField
                        required id="username" label="Никнейм"
                        fullWidth
                    />
                </Grid>
                <Grid item xs={12}>
                    <FormGroup row>
                        <FormControlLabel
                            control={
                                <Checkbox
                                    checked={false}
                                    icon={<LongCompIcon src={LongCompDefault}/>}
                                    checkedIcon={<LongCompIcon src={LongCompActive}/>}
                                    value="long"
                                    color="default"
                                    style={{borderRadius: 0,}}
                                />
                            }
                            label="Длинный"
                            labelPlacement="bottom"
                        />
                        <FormControlLabel
                            control={
                                <Checkbox
                                    checked={false}
                                    icon={<ShortCompIcon src={ShortCompDefault}/>}
                                    checkedIcon={<ShortCompIcon src={ShortCompActive}/>}
                                    value="short"
                                    color="default"
                                    style={{borderRadius: 0,}}
                                />
                            }
                            label="Короткий"
                            labelPlacement="bottom"
                        />
                    </FormGroup>
                </Grid>
            </Grid>
        </>
    )
}


function CompFormContainer() {

    return (
        <SecondaryLayout>
            <PageCaptionSpacer/>

            <FormWrapper maxWidth="xl">
                <InnerFormSpacer>
                    <Typography component="h1" variant="h5" align="center" color="textPrimary">
                        Форма заказа
                    </Typography>

                    <CompForm/>

                    <ButtonsGroup>
                        <Btn variant="outlined">Назад</Btn>
                        <Btn variant="contained">Очистить</Btn>
                        <Btn variant="contained">Заказать</Btn>
                    </ButtonsGroup>

                </InnerFormSpacer>
            </FormWrapper>

        </SecondaryLayout>
    );
}

export default CompFormContainer
